import './admin-css/add-project.css';
import './admin-css/update_socialMedia.css';

export default function Update_socialMedia() {

    return(
        <>
            <div className="add-project-body">
                <div className="project_content">
                    <h2>Social Media Links</h2>
                    <form>
                        <div className='social_media'>  <div className='socialMedia_title'><p>Linked in</p></div> <input style={{width: "80%"}} type="text" placeholder="Linked In" /></div>
                        <div className='social_media'>  <div className='socialMedia_title'><p>Instagram</p></div> <input style={{width: "80%"}} type="text" placeholder="Instagram" /></div>
                        <div className='social_media'>  <div className='socialMedia_title'> <p>Telegram</p></div> <input style={{width: "80%"}} type="text" placeholder="Telegram" /></div>
                        <div className='social_media'>  <div className='socialMedia_title'><p>Github</p> </div><input style={{width: "80%"}} type="text" placeholder="Linked In" /></div>
                        <div className='social_media'>  <div className='socialMedia_title'><p>X</p></div> <input style={{width: "80%"}} type="text" placeholder="X" /></div>
                        <button>Update</button>
                    </form>
                </div>
            </div>
        </>
    );
}
